function migratoryBirds(arr) {
  const one = arr.filter(num => num === 1).length;
  const two = arr.filter(num => num === 2).length;
  const three = arr.filter(num => num === 3).length;
  const four = arr.filter(num => num === 4).length;
  const five = arr.filter(num => num === 5).length;
  const eachLength = [one, two, three, four, five];
  return eachLength.indexOf(Math.max(...eachLength)) + 1;
}

