// ====================
// 問題:
//   arr配列に格納されている数値は鳥の種類のID。配列中に一番多く格納されているIDを返す問題。
//   同じ回数格納されているIDが複数ある場合はIDの小さな方を返す。

// 条件:
//   arr => 出現した鳥の種類のIDを記録した配列。鳥のIDは全部で(1〜5)の5種類だけ。

// ポイント解説:
//   データの準備
//     テストケースの桁数が長すぎるので文字列としてから
//     .split(" ")
//       スペースを除去して文字列としての数値を配列に格納。
//     .map(num => Number(num))
//       できた配列内の全ての値を数値に変換して新しい配列に格納する。

//   Rubyではハッシュを使いましたが、javascriptだと少々面倒でコードが冗長して読みづらくなるので今回はは配列を使って解きました。

//   arr.filter(num => num === 1)
//     配列中から1のみを新しい配列に抽出する

//   eachLength.indexOf(Math.max(...eachLength)) + 1
//     Math.max()は引数に数値の羅列を渡す必要があるのでスプレッド構文(...)で配列を展開する。
//     Math.max()で得た配列中で一番大きな値のインデックスをindexOf()で取得。
//     インデックスは0ベースなので+1が必要。

// ====================
//   Data preparation
//     .split(" ")
//       Remove all the spaces in the string, store each numbers as string into new array.
//     .map(num => Number(num))
//       Convert all the values to integer and store in the new array.

//   Could use hash but the code will be messy. Use array instead for make code straightforward, clean and readable.

//   arr.filter(num => num === 1)
//     Extract 1 from the arr array.

//   eachLength.indexOf(Math.max(...eachLength)) + 1
//     Argument should be comma separated numbers for Math.max(). Use spread syntax (...) to expand array.
//     Get index of the greatest number in the eachLength array by using indexOf() method. Increase 1 as the index is zero based.
